import React, { useCallback, useEffect, useState } from 'react'
import { Form, Button } from 'react-bootstrap';
import axios from 'axios'
import { AgGridReact } from 'ag-grid-react'
import 'ag-grid-community/styles/ag-grid.css'
import 'ag-grid-community/styles/ag-theme-quartz.css'
import '../AppGrid.css';
import { useSkuForm } from './CskuForm';
import { SearchBar } from './SearchBar';

export const GridWarehouseConfig = () => {
    const [rowData, setRowData] = useState({})
    // const colData = {
    //     'Warehouse',
    //     'Origin',
    //     'Countries',
    //     'Shipping'
    // }

    useEffect(() => {
        const fetchData = async () => {
            const response = await axios.get('http://localhost:8000/warehouseconfig');
            setRowData(response.data);
        }
        fetchData();
    }, []);


    window.tra = rowData

    return (
        <div>
            <table>
                <thead>
                    <tr>
                        {Object.keys(rowData['Atlas Logistics Center']).map((key, index) => (
                            <th key={index}>{key}</th>
                        ))}
                        <th>WarehouseName</th>
                    </tr>
                </thead>
                <tbody>
                    {Object.entries(rowData).map(([key, value], index) => (
                        <tr key={index}>
                            {Object.values(value).map((val, i) => (
                                <td key={i}>{Array.isArray(val) ? val.join(', ') : val}</td>
                            ))}
                            <td>{key}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}
